import React  from 'react';

const Raid = (props) => {

const url = "/raids/" + props.raid.id;
  return (

    <Fragment>
      <Link to={url} className="name">
        {props.raid.location}
      </Link>
      <p>Loot: {props.raid.loot}</p>
    </Fragment>
  )
}

export default Raid;
